import {useEffect, useState} from 'react';
import Stations from './Stations';
import {Table} from 'semantic-ui-react';

const VerkaufsstelleBearbeiten = ({station}) => {
    const [stations, setStations]= useState([]);
    
    useEffect(() => {
        fetch("/stations").then(response =>
          response.json().then(data => {
            setStations(data.stations);
            console.log(data.stations)
          })
        );
      }, []);
    return ( 
      <div className="main">
          <p className="home-headline">Verkaufstelle Bearbeiten</p>
          <Table color='black'>
            <Table.Header>
              <Table.Row>
                <Table.HeaderCell>Standort</Table.HeaderCell>
                <Table.HeaderCell>Longitude</Table.HeaderCell>
                <Table.HeaderCell>Latitude</Table.HeaderCell>
                <Table.HeaderCell>Typ</Table.HeaderCell>
                <Table.HeaderCell>Beschreibung</Table.HeaderCell>
                <Table.HeaderCell></Table.HeaderCell>
              </Table.Row>
            </Table.Header>
            <Table.Body>
            {stations.map((station) => (
              <Stations key={station.station_id} station={station} deleteStation={deleteStation} x={station.station_id}/>
            ))}
            </Table.Body>
          </Table>
      </div> 
     );
}
 
export default VerkaufsstelleBearbeiten;
